import React, { Fragment } from "react";
import styles from './AvailableMeals.module.css'
import Card from '../UI/Card'

const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Kolkata Biriyani",
    description: "Finest Fragnence and Test",
    price: 22.99,
  },
  {
    id: "m2",
    name: "Chicken Chap",
    description: "A Mughal specialty!",
    price: 16.5,
  },
  {
    id: "m3",
    name: "Pizza",
    description: "Italian, raw, meaty",
    price: 12.99,
  },
  {
    id: "m4",
    name: "Chicken Tandoori",
    description: "Spicy and Tasty",
    price: 18.99,
  },
];
const AvailableMeals = () => {
  const mealaList = DUMMY_MEALS.map((meals) => <li>{meals.name}</li>);
  return (
    <section className={styles.meals}>
        <Card>
      <ul>{mealaList}</ul>
      </Card>
    </section>
  );
};
export default AvailableMeals;
